
import { Component, OnInit, ViewChild } from '@angular/core';
import { FormControl, FormGroup, Validators } from '@angular/forms';


@Component({
  selector: 'app-dreams-pages-add',
  templateUrl: './dreams-pages-add.component.html',
  styleUrls: ['./dreams-pages-add.component.scss']
})
export class DreamsPagesAddComponent implements OnInit {
  formy: any;
  formy2: any;
  elements: any = [
    {
        "elementType": "app-element-featured",
        "id": 1,
        "data": {
            "imageBackground": "assets/images/notImage.png",
            "title": "",
            "subTitle": "",
            "active": true,
            "featuredItems": [
                {
                    "icon": "data:image/png;base64,",
                    "title": "<p>aaaa</p>",
                    "subTitle1": "<p>aaaa</p>",
                    "subTitle2": "<p>aaaa</p>"
                }
            ]
        }
    }
]

  elemntType: any = [
    { name: 'Slider' , component: 'app-element-slider' },
    { name: 'Seccion', component: 'app-element-section'},
    { name: 'Articulo', component: 'app-element-article'},
    { name: 'Cards', component: 'app-element-cards'},
    { name: 'Destacados', component: 'app-element-featured'},
  ]

  constructor( ) {
    this.formy = new FormGroup({
      title: new FormControl( '' , [ Validators.required ]),
    });

    this.formy2 = new FormGroup({
      element: new FormControl( '' , [ Validators.required ]),
    });
  }
  
  ngOnInit(): void {

  }

  addElement(){
    let error =  0
    let slider = this.elements.find((element: any) => element.elementType === 'app-element-slider')?.elementType;
  
    if(this.formy2.value.element == ''){
      error++
    }

    if(this.formy2.value.element == slider){
      error++
    }

    if(error == 0) {
      let id = this.elements.length + 1;
      let element = this.formy2.value.element;

      if(element == "app-element-slider"){
        this.elements.push({ elementType: element, id: id, data: [{
          
            imageDesktop: 'assets/images/notImage.png' ,
            imageMobile: 'assets/images/notImage.png' ,
            title: '' ,
            subTitle: '',
            description: '',
          
        }] })
      }

      if(element == "app-element-section"){
        this.elements.push({ elementType: element, id: id, data:
           {
            title: '' ,
            subTitle: '' , 
            images: [] ,
            buttonTitle: '',
            buttonSubTitle: '',
            active: true,
            activeMenu: true,
            activeMenuButton: true,
          } 
        })
      }

      if(element == "app-element-article"){
        this.elements.push({ elementType: element, id: id, data:
           {
            image : 'assets/images/notImage.png',
            title:'' ,
            subTitle: '',
            description:  '',
          } 
        })
      }

      if(element == "app-element-cards"){
        this.elements.push({ elementType: element, id: id, data:
            [{
            imageBackground: 'assets/images/notImage.png' ,
            icon: 'assets/images/notImage.png' ,
            title: '' ,
            subTitle: '',
            buttonTitle: '',
            urlButton: '',
            col: 1,
            btnActive: true,
          }]
        })
      }

      if(element == "app-element-featured"){
        this.elements.push({ elementType: element, id: id, data:
            {
            imageBackground: 'assets/images/notImage.png' ,
            title: '' ,
            subTitle: '',
            active: true,
            featuredItems: [],
          }
        })
      }

      this.formy2.reset();
    }
  }

  handleData(data: any, index: any) {

    if(data === "delete"){
      this.elements.splice(index, 1);
      console.log(this.elements);
      return;
    }

    this.elements[index].data = data;
    console.log(this.elements);
  }

}
